import React from "react";
import { Link } from "react-router-dom";
import {
  Box,
  Container,
  Grid,
  Typography,
  IconButton,
  Divider,
} from "@mui/material";
import {
  Facebook,
  Instagram,
  Twitter,
  YouTube,
  Email,
  Phone,
  LocationOn,
} from "@mui/icons-material";
import FDADisclaimer from "./FDADisclaimer";

export default function Footer() {
  const currentYear = new Date().getFullYear();

  const quickLinks = [
    { label: "Home", href: "/" },
    { label: "Products", href: "/products" },
    { label: "New Arrivals", href: "/products?category=new-arrivals" },
    { label: "Sale", href: "/products?sale=true" },
  ];

  const customerService = [
    { label: "Contact Us", href: "/contact" },
    { label: "FAQ", href: "/faq" },
    { label: "Shipping Info", href: "/shipping" },
    { label: "Returns & Exchanges", href: "/returns" },
  ];

  const categories = [
    { label: "Vitamins & Minerals", href: "/products?type=Vitamins & Minerals" },
    { label: "Protein & Fitness", href: "/products?type=Protein & Fitness" },
    { label: "Weight Management", href: "/products?type=Weight Management" },
    { label: "Beauty & Skin", href: "/products?type=Beauty & Skin" },
    { label: "Digestive Health", href: "/products?type=Digestive Health" },
    { label: "Brain & Focus", href: "/products?type=Brain & Focus" },
    { label: "Immune Support", href: "/products?type=Immune Support" },
  ];

  return (
    <footer>
      {/* Main Footer */}
      <Box sx={{ bgcolor: "#1a1a2e", color: "white", py: { xs: 4, sm: 6 } }}>
        <Container maxWidth="lg" sx={{ px: { xs: 2, sm: 3 } }}>
          <Grid container spacing={{ xs: 3, sm: 4 }}>
            {/* Brand Column */}
            <Grid item xs={12} md={4}>
              <Box sx={{ mb: 2, textAlign: { xs: "center", md: "left" } }}>
                <img
                  src="/logo-ltk.png"
                  alt="LTK Ecommerce"
                  style={{ height: "60px" }}
                />
              </Box>
              <Typography
                sx={{ color: "rgba(255,255,255,0.7)", mb: 2, maxWidth: { md: 300 }, mx: { xs: "auto", md: 0 }, textAlign: { xs: "center", md: "left" }, fontSize: { xs: "0.85rem", sm: "1rem" } }}
              >
                Your trusted source for premium health supplements. Quality, 
                science-backed nutrition for a healthier you.
              </Typography>
              <Box sx={{ display: "flex", gap: 1, justifyContent: { xs: "center", md: "flex-start" } }}>
                <IconButton
                  size="small"
                  sx={{
                    color: "white",
                    bgcolor: "rgba(255,255,255,0.1)",
                    "&:hover": { bgcolor: "#667eea" },
                  }}
                >
                  <Facebook fontSize="small" />
                </IconButton>
                <IconButton
                  size="small"
                  sx={{
                    color: "white",
                    bgcolor: "rgba(255,255,255,0.1)",
                    "&:hover": { bgcolor: "#667eea" },
                  }}
                >
                  <Instagram fontSize="small" />
                </IconButton>
                <IconButton
                  size="small"
                  sx={{
                    color: "white",
                    bgcolor: "rgba(255,255,255,0.1)",
                    "&:hover": { bgcolor: "#667eea" },
                  }}
                >
                  <Twitter fontSize="small" />
                </IconButton>
                <IconButton
                  size="small"
                  sx={{
                    color: "white",
                    bgcolor: "rgba(255,255,255,0.1)",
                    "&:hover": { bgcolor: "#667eea" },
                  }}
                >
                  <YouTube fontSize="small" />
                </IconButton>
              </Box>
            </Grid>

            {/* Quick Links */}
            <Grid item xs={6} sm={4} md={2}>
              <Typography
                sx={{ fontWeight: 600, mb: { xs: 1.5, sm: 2 }, color: "#ffd93d", fontSize: { xs: "0.9rem", sm: "1rem" } }}
              >
                Quick Links
              </Typography>
              {quickLinks.map((link) => (
                <Link
                  key={link.label}
                  to={link.href}
                  style={{ textDecoration: "none" }}
                >
                  <Typography
                    sx={{
                      color: "rgba(255,255,255,0.7)",
                      mb: { xs: 0.75, sm: 1 },
                      fontSize: { xs: "0.8rem", sm: "0.9rem" },
                      "&:hover": { color: "white" },
                      transition: "color 0.2s",
                    }}
                  >
                    {link.label}
                  </Typography>
                </Link>
              ))}
            </Grid>

            {/* Categories */}
            <Grid item xs={6} sm={4} md={2}>
              <Typography
                sx={{ fontWeight: 600, mb: { xs: 1.5, sm: 2 }, color: "#ffd93d", fontSize: { xs: "0.9rem", sm: "1rem" } }}
              >
                Categories
              </Typography>
              {categories.map((link) => (
                <Link
                  key={link.label}
                  to={link.href}
                  style={{ textDecoration: "none" }}
